ISLAMABAD, Sep 11 (APP): The session of National Assembly on Wednesday commenced with a recitation of verses from the Holy Quran, Hadith, Naat, and National Anthem with Deputy Speaker Syed Mir Ghulam Mustafa Shah in the Chair.
The important agenda items included Question Hour, two calling attention notices, legislative business, and further discussion of Presidential address to the Joint Sitting.
